import React from 'react';
import CustomNavbar from '../components/CustomNavbar';
import TrackingBanner from '../components/Banner/TrackingBanner';
import TrackingActivity from '../components/TrackingActivity';
import TrackingProduct from '../components/Features/TrackingProduct';
import TrackingPrice from '../components/TrackingPrice';
import TrackingGetstarted from '../components/TrackingGetstarted';
import FooterSecurity from "../components/Footer/FooterSecurity";
import FooterData from '../components/Footer/FooterData';

const homesupport = () => {

    useEffect(() => {
        const anchor = document.createElement("a");
        anchor.setAttribute("class", "twitter-timeline");
        anchor.setAttribute("data-theme", "dark");
        anchor.setAttribute("data-tweet-limit", "5");
        anchor.setAttribute("data-chrome", "noheader nofooter noborders");
        anchor.setAttribute("href", "https://twitter.com/HeyMarkKop");
        document.getElementsByClassName("twitter-embed")[0].appendChild(anchor);
    
        const script = document.createElement("script");
        script.setAttribute("src", "https://platform.twitter.com/widgets.js");
        document.getElementsByClassName("twitter-embed")[0].appendChild(script);
      }, []);
    return(
        <div className="body_wrapper">
            <CustomNavbar mClass="menu_tracking" nClass="mr-auto" hbtnClass="tracking_btn"/>{/* ESTA ES LA PARTE DEL MENU DEL HOME */}
            <TrackingBanner/> {/* ESTA ES LA PARTE DEL BANNER PRINCIPAL DEL HOME */}
            {/*<TrackingActivity/> {/* ESTA ES LA PARTE DE LOS LOGOS */}
            <TrackingProduct/>  {/* ESTA ES LA PARTE DE LAS SECCIONES PRINCIPALES */}
            {/* <TrackingPrice/>ESTA ES LA PARTE DEL LOS PRECIOS */}
            {/*<TrackingGetstarted/> ESTA ES LA PARTE DE REGISTRARSE */}
            <section className="twitterContainer">
      <div className="twitter-embed"></div>
    </section>
            <FooterSecurity FooterData={FooterData}/>
        </div>
    )
}
export default homesupport;
